import React from "react";
import './Home.css';
import {Grid, Paper} from '@material-ui/core';

let nome = 'Rafael Souza'

function Home(){
    return(
        <>
        <Grid container>
            <Grid item>
                <Paper style={{}} />
            </Grid>

            <Grid item container>
                <Grid item>
                    <Paper />
                </Grid>

                <Grid item>
                    <Paper />
                </Grid>

            </Grid>
        </Grid>
        </>
    );

}

export default Home;
